import React from 'react';
import './authorization.css';

import {Link} from 'react-router-dom';

const Authorization = () => {

    return (
        <div className="auth-screen">
            <div className="auth-block align-middle">
                <div>

                </div>
                <form method="post">
                    <h5>Authorization</h5>
                    <label className="label-block">
                        Login
                        <input type="text" name="title" placeholder="..." className="form-control"/>
                    </label>
                    <br/>
                    <label className="label-block">
                        Password
                        <input type="password" name="anons" placeholder="..." className="form-control"/>
                    </label>
                    <br/>
                    <Link to="./book_fund" type="submit" className="btn btn-info auth-button">Log in</Link>
                </form>
                <Link to="./registration" className="btn btn-info reg-button">Registration</Link>
            </div>
        </div>
    )

};

export default Authorization;
